--
-- Name: complete; Type: VIEW; Schema: public; Owner: nkagent
--

CREATE VIEW complete AS
 SELECT node.id,
    node.title,
    node.template,
    apartment.agent,
    node.date_create,
    node.date_edit,
    node.section,
    apartment.type,
    apartment.street,
    apartment.price,
    apartment.note,
    node.status,
    node.main
   FROM (node
     LEFT JOIN apartment ON ((node.id = apartment.node_id)))
UNION
 SELECT node.id,
    node.title,
    node.template,
    cottages.agent,
    node.date_create,
    node.date_edit,
    node.section,
    cottages.type,
    cottages.street,
    cottages.price,
    cottages.note,
    node.status,
    node.main
   FROM (node
     LEFT JOIN cottages ON ((node.id = cottages.node_id)))
UNION
 SELECT node.id,
    node.title,
    node.template,
    commercial.agent,
    node.date_create,
    node.date_edit,
    node.section,
    commercial.type,
    commercial.street,
    commercial.price,
    commercial.note,
    node.status,
    node.main
   FROM (node
     LEFT JOIN commercial ON ((node.id = commercial.node_id)));


ALTER TABLE public.complete OWNER TO nkagent;

